var time=document.getElementById('time');
var start=document.getElementById('start');
var stop=document.getElementById('stop');
var reset=document.getElementById('reset');
var pomodoro=document.getElementById('pomodoro');
var shortBreak=document.getElementById('short-break');
var longBreak=document.getElementById('long-break');
var title=document.getElementById('title');
var timeControls=document.getElementById('time-controls');
var minutes;
var seconds;
var timeInterval;
var globalMinutes;
var globalSeconds

window.addEventListener('load',function(){
    setTime(25,0);
    setGlobal(25,0);
});
pomodoro.addEventListener('click',function(){
    timeControls.style.display='block';
    stopTimer();
    setTime(25,0);
    setGlobal(25,0);
});
shortBreak.addEventListener('click',function(){
    timeControls.style.display='block';
    stopTimer();
    setTime(5,0);
    setGlobal(5,0)
});
longBreak.addEventListener('click',function(){
    timeControls.style.display='block';
    stopTimer();
    setTime(10,0);
    setGlobal(10,0)
});
start.addEventListener('click',function(){
    if(minutes==0 && seconds==0){
        startTimer(globalMinutes,globalSeconds)
    }else{
        startTimer(minutes,seconds);
    }
});
reset.addEventListener('click', function(){
    setTime(''+globalMinutes,''+globalSeconds);
    stopTimer();
});

stop.addEventListener('click',stopTimer);

function setTime(minutesInput,secondsInput){
    var minutesString = ("0" + minutesInput).slice(-2);
    var secondsString = ("0" + secondsInput).slice(-2);
    title.innerHTML=`(${minutesString}:${secondsString})Counter`;
    time.innerHTML=`${minutesString}:${secondsString}`;
    minutes=minutesInput;
    seconds=secondsInput;
}

function startTimer(minutes,seconds){
     timeInterval = setInterval(() => {
        if(seconds-1<0){
            minutes=minutes-1;
            seconds=59;
        }else{
            seconds--;
        }
        setTime(minutes,seconds);
        if(seconds===0 && minutes===0){
           stopTimer();
           beep();
        }
    }, 1000);
}

function stopTimer(){
    clearInterval(timeInterval);
}

function setGlobal(minutes, seconds){
    globalMinutes=minutes;
    globalSeconds=seconds;
}

function beep() {
    var snd = new Audio("data:audio/mpeg;base64,");  
    snd.play();
}
